    queue.testMode.exit();
  });

  it("if jobs is not an array passing Number", () => {
    expect(() => {
      createPushNotificationsJobs(2, queue);
    }).to.throw("Jobs is not an array");
  });

  it("if jobs is not an array passing Object", () => {
    expect(() => {
      createPushNotificationsJobs({}, queue);
